import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; 
import Landing from './pages/Landing/Landing';
import Menu from './Menu'; 

function App() {
  return (
    <Router>
      <div className="App">
        <Menu />  {/* Navigation menu */}
        <Routes>
          <Route path="/" element={<Landing />} />       {/* Landing page route */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
